properties.description:
Moment.js object describing the date/time represented by the picker component.
For more information, see https://momentjs.com/docs. There are many ways to set the time
value via Moment.js.  You must initialize the property `momentObj` to an
instance of `moment`. Here are some variations for your application code:

```javascript
  // alternate 1, set time value to current time 
  this.momentObj = window['GEHC'].EDS.moment();

  // alternate 2, one line initialize and set value, specifying 24HR format:
  this.momentObj = window['GEHC'].EDS.moment('15:55', 'HH:mm');

  // alternate 3, one line initialize and set value, specifying 12HR format:
  this.momentObj = window['GEHC'].EDS.moment('2:35 pm', 'hh:mm a');

  // alternate 4, initialize first, then use object format of moment `set`
  // method:
  this.momentObj = window['GEHC'].EDS.moment();
  this.momentObj.set({hour: 15, minute: 33});

  // alternate 5, pass a null value to set placeholder (HH::MM) string
  this.momentObj = window['GEHC'].EDS.moment(null);

```

Please consult the Moment.js documentation for full details.

Your application's `momentObj` must be set on the `eds-time-picker` property
of `momentObj`.
